import  { HomeStyle } from "./homeStyle"

import { useState } from 'react'


const Home = (props) => {

    const {renderList, amount, cart} = props

    const [ordination, setOrdination] = useState("")
    const [adicionarItens, setAdicionarItens] = useState("")

    const ordenacao = (e) => {
        setOrdination(e.target.value)
    }

    const adcionarItensFuncao = (e) => {
        setAdicionarItens(e.target.value)
    }




        return(
      <div>
       <select onChange={ordenacao} value={ordination}>       
       </select>
       <input type="list" value={renderList}/>
       <input type="number" onChange ={props.quantia()} value={amount}/>
       <input type="cart" onChange={props.carrinho()} value={cart}/>    
       <button onChange={adcionarItensFuncao} value={adicionarItens}></button>     
       </div>


        )
    }

export default Home
